import React from 'react';
import Title from './Title';

class SolarSystem extends React.Component {
  render() {
    const plantent = 'Matheus';
    return (
      <div data-testid="solar-system">
        <p>
          {plantent}
        </p>
        <Title />
      </div>
    );
  }
}

export default SolarSystem;
